      const W = JSON.parse('{"de-DE":{"rdr2_companion_app_paragraph_2":"Die Begleit-App beinhaltet die vollständige Karte. Du kannst die Karte schwenken und zoomen, Wegpunkte setzen oder mit einer Berührung des Bildschirms interessante Orte markieren, um dir bei der Erkundung der riesigen weiten Welt von Red Dead Redemption 2 zu helfen. Außerdem zeigt die App Arthur Morgans Kerne und Werte in Echtzeit auf deinem Mobilgerät an und ermöglicht es dir so, das HUD des Spiels auf Wunsch komplett von deinem Fernsehbildschirm zu entfernen. Zudem kannst du über die App Arthurs Tagebuch im Spiel lesen und deine Statistiken verfolgen. Die App enthält das vollständige digitale Spielehandbuch sowie eine optionale digitale Version des offiziellen Guides zu Red Dead Redemption 2 von Piggyback und mehr.","rdr2_credits_additional_cast_title":"Weitere Besetzung","rdr2_credits_main_cast_title":"Die Besetzung","rdr2_credits_outlaws_title":"Outlaw-Banden des Südens und Westens","rdr2_credits_outsource_title":"Dienstleistungen für Kunst und Animation (outsourced)","rdr2_download_android":"Hol dir die offizielle Begleit-App für Red Dead Redemption 2 bei Google Play.","rdr2_download_ios":"Lade die offizielle Begleit-App für Red Dead Redemption 2 im App Store herunter.","rdr2_download_label":"Herunterladen: Bild {name}, Größe: {size}","rdr2_download_pixels_label":"Herunterladen: Bild {name}, Größe: {size1} Pixel mal {size2} Pixel","rdr2_legacy_credits_title":"Legacy Credits","rdr2_pc_missions4_bonus_first_half":"Außerdem enthält Red Dead Redemption 2 für PC einen neuen Fotomodus, mit einer Fülle an Optionen, um die Schönheit des Grenzlandes im Story-Modus einzufangen. Nehmt mit der freibeweglichen Kamera Bilder auf und verseht sie mit Filtern, Stickern oder Text und","rdr2_pc_missions4_bonus_second_half":", um sie mit der Community zu teilen.","rdr2_pc_missions4_bonus_upload_message":"ladet sie hoch","rdr2_pc_missions4_list_item1":"<span>Habichtkralle</span> – Verringert die Geschwindigkeit, mit der sich beim Bogenspannen die Ausdauer leert, dauerhaft um 30 %","rdr2_pc_missions4_list_item2":"<span>Katzenauge</span> – Erhöht die Wirkungsdauer von verstärkenden Tonika dauerhaft um 20 %","rdr2_pc_missions4_list_item3":"<span>Haizahn</span> – Erhöht die Geschwindigkeit, mit der Pferdeverbundenheit zunimmt, dauerhaft um 10 %","rdr2_pc_missions4_list_item4":"<span>Schildkrötenpanzer</span> – Erhöht die Geschwindigkeit, mit der sich Gesundheit wieder auffüllt, dauerhaft um 10 %","rdr2_pc_missions4_list_item5":"<span>Krähenschnabel</span> – Erhöht die Menge geplünderter Munition dauerhaft um 10 %<","rdr2_pc_missions4_list_title":"Fünf neue <span>Amulette</span> mit neuen Effekten zum Sammeln:","rdr2_pc_missions4_new_mission":"<p>Die neue Mission <span>„In den entlegensten Winkeln der Welt“</span> – Sammelt angefragte Kräuter, um eine Reihe an Belohnungen zu erhalten</p>"},"en-US":{"rdr2_companion_app_paragraph_2":"The Companion app includes the full map. You can pan and zoom, set waypoints or mark areas of interest with a tap on your screen, aiding your exploration and discovery throughout the expansive world of Red Dead Redemption 2. Additionally, you can track Arthur Morgan\'s core info and stats in real-time on your device, allowing you to completely remove the in-game HUD from your television should you choose. The app also lets you examine Arthur\'s in-game Journal, provides stat tracking, contains the full digital game manual, plus an optional digital version of the Red Dead Redemption 2 Complete Official Guide from Piggyback and more.","rdr2_credits_additional_cast_title":"Additional Cast","rdr2_credits_main_cast_title":"The Cast","rdr2_credits_outlaws_title":"Outlaw Gangs of the South and West","rdr2_credits_outsource_title":"Outsource Art and Animation Services","rdr2_download_android":"Get Red Dead Redemption 2 Official Companion App on Google Play.","rdr2_download_ios":"Download Red Dead Redemption 2 Official Companion App on the App Store.","rdr2_download_label":"Download {name} image in {size} size.","rdr2_download_pixels_label":"Download {name} image of {size1} pixels by {size2} pixels.","rdr2_legacy_credits_title":"Legacy Credits","rdr2_pc_missions4_bonus_first_half":"Plus, Red Dead Redemption 2 for PC includes a new Photo Mode, with an assortment of tools to unlock the beauty of the frontier in Story Mode. Capture images with free form camera movement and add Filters, Stickers or Text then","rdr2_pc_missions4_bonus_second_half":"to share with the community.","rdr2_pc_missions4_bonus_upload_message":"upload them","rdr2_pc_missions4_list_item1":"<span>Hawk Talon</span> – permanently decreases Stamina bar drain speed by 30% when drawing a bow","rdr2_pc_missions4_list_item2":"<span>Cat Eye</span> – permanently increases the length of Fortifying tonic effects by 20%","rdr2_pc_missions4_list_item3":"<span>Shark Tooth</span> – permanently increases horse bonding experience bonus by 10%","rdr2_pc_missions4_list_item4":"<span>Turtle Shell</span> – permanently increases health bar refill speed by 10%","rdr2_pc_missions4_list_item5":"<span>Crow Beak</span> – permanently increases looted ammo by 10%","rdr2_pc_missions4_list_title":"5 New <span>Trinkets</span> to collect with new effects:","rdr2_pc_missions4_new_mission":"<span>New mission \\"To The Ends of The Earth\\"</span> – collect requested herbs for a range of rewards"},"es-ES":{"rdr2_companion_app_paragraph_2":"La aplicación complementaria incluye el mapa completo. Solo tienes que tocar la pantalla para girarlo, usar el zoom, fijar destinos o marcar zonas de interés, lo que te ayudará a explorar el gran mundo abierto de Red Dead Redemption 2. Además, puedes hacer un seguimiento de las estadísticas y la información básica de Arthur Morgan en tiempo real en tu dispositivo, por lo que podrás ocultar totalmente la interfaz del juego en tu televisor, si así lo deseas. La aplicación también te permite consultar el diario de Arthur y seguir las estadísticas. Además, contiene el manual completo del juego en versión digital e incluye una versión digital y opcional de la guía completa oficial de Red Dead Redemption 2, publicada por Piggyback, y mucho más.","rdr2_credits_additional_cast_title":"Reparto adicional","rdr2_credits_main_cast_title":"Reparto","rdr2_credits_outlaws_title":"Cuadrillas de forajidos del sur y el oeste","rdr2_credits_outsource_title":"Servicios externalizados de arte y animación","rdr2_download_android":"Obtén la aplicación complementaria de Red Dead Redemption 2 en Google Play.","rdr2_download_ios":"Obtén la aplicación complementaria de Red Dead Redemption 2 en la App Store.","rdr2_download_label":"Descargar la imagen «{name}» en tamaño {size}.","rdr2_download_pixels_label":"Descargar la imagen «{name}» en {size1} por {size2} píxeles.","rdr2_legacy_credits_title":"Créditos originales","rdr2_pc_missions4_bonus_first_half":"Además, Red Dead Redemption 2 para PC incluye un nuevo modo Foto con varias herramientas que revelarán la belleza de la frontera en el Modo Historia. Captura imágenes gracias a la cámara libre, añádeles filtros, pegatinas o texto y","rdr2_pc_missions4_bonus_second_half":"súbelas","rdr2_pc_missions4_bonus_upload_message":"para compartirlas con la comunidad.","rdr2_pc_missions4_list_item1":"<span>Garra de halcón</span> – reduce permanentemente en un 30 % la velocidad a la que se agota la barra de resistencia al apuntar con el arco.","rdr2_pc_missions4_list_item2":"<span>Ojo de gato</span> – aumenta permanentemente en un 20 % la duración de los efectos de los tónicos fortalecedores.","rdr2_pc_missions4_list_item3":"<span>Diente de tiburón</span> – aumenta permanentemente en un 10 % el vínculo con el caballo.","rdr2_pc_missions4_list_item4":"<span>Caparazón de tortuga</span> – aumenta permanentemente en un 10 % la velocidad a la que se restablece la barra de salud.","rdr2_pc_missions4_list_item5":"<span>Pico de cuervo</span> – aumenta permanentemente en un 10 % la cantidad de munición que se obtiene al saquear.","rdr2_pc_missions4_list_title":"5 nuevos <span>abalorios</span> con los que podrás obtener con nuevos efectos:","rdr2_pc_missions4_new_mission":"<span>Nueva misión \\"Hasta los confines de la Tierra\\":</span> – recoge las hierbas requeridas y obtén diversas recompensas"},"es-MX":{"rdr2_companion_app_paragraph_2":"La Aplicación Complementaria incluye el mapa completo. Solo tienes que tocar la pantalla para girarlo, usar el zoom, fijar destinos o marcar zonas de interés, lo que te ayudará a explorar el gran mundo abierto de Red Dead Redemption 2. Además, puedes hacer un seguimiento de las estadísticas y la información básica de Arthur Morgan en tiempo real en tu dispositivo, por lo que podrás eliminar totalmente el HUD del juego de tu televisión, si así lo deseas. La aplicación también te permite consultar el diario de Arthur y seguir las estadísticas. Además, contiene el manual completo del juego en versión digital e incluye una versión digital y opcional de la guía completa oficial de Red Dead Redemption 2, publicada por Piggyback®, y más.","rdr2_credits_additional_cast_title":"Reparto adicional","rdr2_credits_main_cast_title":"Reparto","rdr2_credits_outlaws_title":"Bandas de forajidos del sur y el oeste","rdr2_credits_outsource_title":"Servicios de arte y animación subcontratados","rdr2_download_android":"Descarga la Aplicación Complementaria oficial de Red Dead Redemption 2 desde Google Play.","rdr2_download_ios":"Descarga la Aplicación Complementaria oficial de Red Dead Redemption 2 desde la App Store.","rdr2_download_label":"Descarga la imagen {name} con la siguiente resolución: {size}.","rdr2_download_pixels_label":"Descarga la imagen {name} de {size1} píxeles por {size2} píxeles.","rdr2_legacy_credits_title":"Créditos anteriores","rdr2_pc_missions4_bonus_first_half":"Además, Red Dead Redemption 2 para PC incluye un nuevo Modo Foto con varias herramientas que revelarán la belleza de la frontera en el Modo Historia. Captura imágenes utilizando la cámara libre, añádeles filtros, etiquetas o texto, y ","rdr2_pc_missions4_bonus_second_half":"para compartirlas con la comunidad.","rdr2_pc_missions4_bonus_upload_message":"súbelas ","rdr2_pc_missions4_list_item1":"<span>Garra de halcón</span>: reduce permanentemente en un 30% la velocidad a la que se agota la barra de resistencia al apuntar con el arco.","rdr2_pc_missions4_list_item2":"<span>Ojo de gato</span>: aumenta permanentemente en un 20% la duración de los efectos del tónico fortalecedor.","rdr2_pc_missions4_list_item3":"<span>Diente de tiburón</span>: aumenta permanentemente en un 10% la experiencia que se obtiene al crear un vínculo con el caballo.","rdr2_pc_missions4_list_item4":"<span>Caparazón de tortuga</span>: aumenta permanentemente en un 10% la velocidad a la que se restablece la barra de salud.","rdr2_pc_missions4_list_item5":"<span>Pico de cuervo</span>: aumenta permanentemente en un 10% la cantidad de munición que se obtiene al saquear.","rdr2_pc_missions4_list_title":"5 nuevos <span>dijes</span> con nuevas funciones:","rdr2_pc_missions4_new_mission":"<span>Nueva misión “Hasta los confines de la Tierra”</span>: consigue ciertas hierbas para obtener una serie de recompensas."},"fr-FR":{"rdr2_companion_app_paragraph_2":"L\'application compagnon inclut la carte complète. Vous pouvez zoomer sur la carte, placer des repères ou marquer des zones d\'intérêt en tapotant simplement l\'écran, afin de vous aider à explorer et découvrir le monde gigantesque de Red Dead Redemption 2. L\'application affiche également en temps réel les informations et statistiques les plus importantes pour Arthur Morgan sur votre appareil, ce qui vous permet de masquer complètement l\'interface du jeu sur votre téléviseur, si vous le souhaitez. En plus de vous permettre de feuilleter le carnet en jeu d\'Arthur, l\'application compagnon vous permet de suivre des statistiques, contient le manuel complet du jeu au format numérique ainsi qu\'une version numérique du Guide officiel complet de Red Dead Redemption 2 par Piggyback (en supplément), et plus.","rdr2_credits_additional_cast_title":"Distribution supplémentaire","rdr2_credits_main_cast_title":"Distribution","rdr2_credits_outlaws_title":"Bandes de hors-la-loi du Sud et de l’Ouest","rdr2_credits_outsource_title":"Services externes d’art et d’animation","rdr2_download_android":"Obtenez l\'application compagnon officielle de Red Dead Redemption 2 sur Google Play.","rdr2_download_ios":"Téléchargez l\'application compagnon officielle de Red Dead Redemption 2 sur l\'App Store.","rdr2_download_label":"Téléchargez l\'image {name} en taille {size}.","rdr2_download_pixels_label":"Téléchargez l\'image {name} en {size1}x{size2}.","rdr2_legacy_credits_title":"Crédits originels","rdr2_pc_missions4_bonus_first_half":"Red Dead Redemption 2 sur PC inclut également un mode Photo, disposant d\'un large éventail d\'outils qui vous permettront de capturer la beauté de l\'Ouest sauvage du mode Histoire. Prenez des clichés avec une caméra libre, ajoutez des filtres, des autocollants ou du texte, puis","rdr2_pc_missions4_bonus_second_half":"pour les partager avec la communauté.","rdr2_pc_missions4_bonus_upload_message":"publiez-les","rdr2_pc_missions4_list_item1":"<span>Serre de faucon</span> : réduit de manière permanente la vitesse à laquelle la jauge d\'énergie se vide lorsque vous bandez un arc de 30 %.","rdr2_pc_missions4_list_item2":"<span>Œil de chat</span> : augmente de manière permanente la durée des effets du fortifiant de 20 %.","rdr2_pc_missions4_list_item3":"<span>Dent de requin</span> : augmente de manière permanente l\'expérience du lien d\'affection avec le cheval de 10 %.","rdr2_pc_missions4_list_item4":"<span>Carapace de tortue</span> : augmente de manière permanente la vitesse à laquelle la jauge de santé se remplit de 10 %.","rdr2_pc_missions4_list_item5":"<span>Bec de corneille</span> : augmente de manière permanente la quantité de munitions trouvées en fouillant de 10 %.","rdr2_pc_missions4_list_title":"Cinq nouvelles <span>amulettes</span> à collectionner avec de nouveaux effets :","rdr2_pc_missions4_new_mission":"Une nouvelle mission : <span>\\"Aux quatre coins de la terre\\"</span>. Cueillez les plantes demandées pour obtenir des récompenses."},"it-IT":{"rdr2_companion_app_paragraph_2":"La Companion app include tutta la mappa. Ti permette di scorrerla e di ingrandirla, impostare mete o contrassegnare aree d\'interesse con un semplice tocco dello schermo, assistendoti nell\'esplorazione e nella scoperta del vastissimo mondo di Red Dead Redemption 2. Inoltre, mostra in tempo reale sul tuo dispositivo anche le informazioni vitali di Arthur Morgan, permettendoti anche di rimuovere l\'interfaccia di gioco dallo schermo. In più, consente di leggere il diario di Arthur, monitorare le statistiche, consultare il manuale completo in formato digitale e una versione opzionale della Guida ufficiale completa di Red Dead Redemption 2 di Piggyback, e altro.","rdr2_credits_additional_cast_title":"Altri personaggi","rdr2_credits_main_cast_title":"I protagonisti","rdr2_credits_outlaws_title":"Bande fuorilegge del sud e dell’ovest","rdr2_credits_outsource_title":"Arte e animazioni di terze parti","rdr2_download_android":"Ottieni la Companion app ufficiale di Red Dead Redemption 2 su Google Play.","rdr2_download_ios":"Scarica la Companion app ufficiale di Red Dead Redemption 2 sull’App Store.","rdr2_download_label":"Scarica l’immagine “{name}” in formato {size}.","rdr2_download_pixels_label":"Scarica l’immagine “{name}” in formato {size1} pixel x {size2} pixel.","rdr2_legacy_credits_title":"Legacy Credits","rdr2_pc_missions4_bonus_first_half":"Inoltre, Red Dead Redemption 2 per PC include una nuova modalità Foto arricchita con una serie di strumenti per immortalare al meglio la bellezza della frontiera nella modalità Storia. Scatta foto senza limitazioni al movimento della macchina fotografica e aggiungi filtri, adesivi e testi","rdr2_pc_missions4_bonus_second_half":"e condividile con la community.","rdr2_pc_missions4_bonus_upload_message":"e caricale","rdr2_pc_missions4_list_item1":"<span>Artiglio di falco</span> – Riduce permanentemente del 30% la velocità con cui si consuma la barra della Resistenza quando usi un arco","rdr2_pc_missions4_list_item2":"<span>Occhio di gatto</span> – Incrementa permanentemente del 20% la durata degli effetti dei tonici che potenziano le statistiche","rdr2_pc_missions4_list_item3":"<span>Dente di squalo</span> – Incrementa permanentemente del 10% l\'acquisizione di esperienza per rafforzare il legame con il cavallo","rdr2_pc_missions4_list_item4":"<span>Guscio di tartaruga</span> – Incrementa permanentemente del 10% la velocità con cui si ripristina la barra della Salute","rdr2_pc_missions4_list_item5":"<span>Becco di cornacchia</span> – Incrementa permanentemente del 10% le munizioni raccolte","rdr2_pc_missions4_list_title":"5 nuovi <span>amuleti</span> da collezionare, con nuovi effetti:","rdr2_pc_missions4_new_mission":"<span>La nuova missione \\"Fino in capo al mondo\\"</span> – Raccogli le piante richieste per ricevere delle ricompense"},"ja-JP":{"rdr2_companion_app_paragraph_2":"コンパニオンアプリにはフルマップが含まれます。画面をタップしてパンやズーム機能、行き先マーカーの設置、また重要な場所のマークができます。『レッド・デッド・リデンプション2』の広大なオープンワールドで探索や発見がしやすくなります。本アプリでは、アーサー・モーガンの基本ステータスがリアルタイムで確認できるため、ご使用のTVから全てのゲーム内HUDを消した状態で楽しめます。さらに、アーサーのゲーム内日誌を確認したり、データ記録を利用したり、完全版のゲームマニュアルを確認することもコンパニオンアプリから行えます。さらに、オプションでPiggybackによる『レッド・デッド・リデンプション2』公式コンプリートガイドのデジタル版も利用できるなど、他にも様々な機能があります。","rdr2_credits_additional_cast_title":"Additional Cast","rdr2_credits_main_cast_title":"The Cast","rdr2_credits_outlaws_title":"Outlaw Gangs of the South and West","rdr2_credits_outsource_title":"Outsource Art and Animation Services","rdr2_download_android":"Google Play で『レッド・デッド・リデンプション2』の公式コンパニオンアプリを入手しましょう。","rdr2_download_ios":"App Storeで『レッド・デッド・リデンプション2』の公式コンパニオンアプリをダウンロードしましょう。","rdr2_download_label":"{size}サイズでイメージ「{name}」をダウンロード","rdr2_download_pixels_label":"{size1}ピクセルｘ{size2}ピクセルのイメージ{name}をダウンロード","rdr2_legacy_credits_title":"Legacy Credits","rdr2_pc_missions4_bonus_first_half":"さらに、PC版『レッド・デッド・リデンプション2』には新しいフォトモードも含まれています。充実した様々なツールを使うことで、ストーリーモードの美麗な景色を切り取ることができます。自由にカメラを移動させて画像を撮り、フィルターやステッカーまたはテキストで飾ったら、","rdr2_pc_missions4_bonus_second_half":"してコミュニティで公開しましょう。","rdr2_pc_missions4_bonus_upload_message":"アップロード","rdr2_pc_missions4_list_item1":"<span>鷹のかぎ爪</span>：弓を引いた際のスタミナゲージの消耗スピードが30％遅くなる。効果は永久に持続する。","rdr2_pc_missions4_list_item2":"<span>猫の目</span>：強壮剤による効果の持続時間が20％長くなる。効果は永久に持続する。","rdr2_pc_missions4_list_item3":"<span>サメの歯</span>：馬との親密度の経験値に10％のボーナスが付く。効果は永久に持続する。","rdr2_pc_missions4_list_item4":"<span>亀の甲羅</span>：ライフゲージの回復スピードが10％速くなる。効果は永久に持続する。","rdr2_pc_missions4_list_item5":"<span>カラスのくちばし</span>：略奪で手に入る弾薬の数が10％増える。効果は永久に持続する。","rdr2_pc_missions4_list_title":"新たな5つの<span>アクセサリー</span>(集めると新たな効果を解除)：","rdr2_pc_missions4_new_mission":"<span>新しいミッション「大地の果てまで」</span>：荒野でハーバリストのキャンプを訪れ、頼まれた薬草を集めて様々な報酬を手に入れましょう。"},"ko-KR":{"rdr2_companion_app_paragraph_2":"컴패니언 앱에는 전체 지도가 포함됩니다. 사용자는 지도를 회전하거나 확대, 축소하고 경유지를 설정하거나, 화면을 탭해서 관심 지역을 표시할 수 있어 드넓은 Red Dead Redemption 2의 세계를 둘러보고 탐험하는 데 도움을 드립니다.  또한, 이 앱으로 아서 모건의 기본 정보를 확인할 수 있고 통계도 실시간으로 여러분의 기기에 표시되기 때문에 사용 중인 TV나 모니터에서 게임 내 HUD를 완전히 제거해도 될 정도입니다. 컴패니언 앱에서는 아서의 게임 내 일지를 볼 수 있고, 각종 통계 및 디지털 게임 설명서 전체를 확인할 수 있습니다. 또한 선택 사항으로 Piggyback에서 만든 Red Dead Redemption 2 컴플리트 공식 가이드의 디지털 버전도 이용할 수 있는 등 다양한 기능이 있습니다.","rdr2_credits_additional_cast_title":"Additional Cast","rdr2_credits_main_cast_title":"The Cast","rdr2_credits_outlaws_title":"Outlaw Gangs of the South and West","rdr2_credits_outsource_title":"Outsource Art and Animation Services","rdr2_download_android":"Google Play에서 Red Dead Redemption 2 공식 컴패니언 앱 다운로드.","rdr2_download_ios":"App Store에서 Red Dead Redemption 2 공식 컴패니언 앱 다운로드.","rdr2_download_label":"{size} 크기의 {name} 이미지 다운로드.","rdr2_download_pixels_label":"{size1} x {size2} 픽셀의 {name} 이미지 다운로드.","rdr2_legacy_credits_title":"Legacy Credits","rdr2_pc_missions4_bonus_first_half":"또한, PC용 Red Dead Redemption 2에는 신규 사진 모드가 포함되어 있습니다. 다양한 도구를 잠금 해제하고 스토리 모드에서 개척지의 아름다움을 사진 속에 담아 보십시오. 자유 카메라로 사진을 찍고 필터, 스티커, 텍스트를 추가하세요. 찍고 편집한 사진은","rdr2_pc_missions4_bonus_second_half":"커뮤니티와 공유할 수 있습니다.","rdr2_pc_missions4_bonus_upload_message":"업로드하여","rdr2_pc_missions4_list_item1":"<span>매 발톱</span> - 활을 당길 때 기력 게이지가 감소되는 속도를 영구적으로 30% 늦춥니다","rdr2_pc_missions4_list_item2":"<span>고양이 눈</span> - 강장제 효과의 지속 시간이 영구적으로 20% 증가합니다","rdr2_pc_missions4_list_item3":"<span>상어 이빨</span> - 말 친밀도 경험치 보너스가 영구적으로 10% 증가합니다","rdr2_pc_missions4_list_item4":"<span>거북 껍질</span> - 체력 게이지 회복 속도가 영구적으로 10% 증가합니다","rdr2_pc_missions4_list_item5":"span>까마귀 부리</span> - 노획한 탄약의 양이 영구적으로 10% 증가합니다","rdr2_pc_missions4_list_title":"새로운 효과를 얻을 수 있는 5개의 신규 <span>장신구</span>:","rdr2_pc_missions4_new_mission":"<span>새로운 임무 \\"세상이 끝나는 날까지\\"</span> – 요청받은 약초를 획득하여 다양한 보상을 얻으십시오."},"pl-PL":{"rdr2_companion_app_paragraph_2":"Aplikacja towarzysząca zawiera pełną mapę. Mapę można przesuwać i przybliżać/oddalać, a także wykorzystywać do zaznaczania jednym gestem punktów nawigacyjnych, co ułatwia eksplorację olbrzymiego świata Red Dead Redemption 2. Aplikacja pokazuje również na urządzeniu mobilnym główne informacje o Arthurze Morganie i jego statystyki, podając je w czasie rzeczywistym. Dzięki temu można zupełnie wyłączyć interfejs na telewizorze. Oprócz tego aplikacja pozwala przeglądać dziennik Arthura z gry, śledzić statystyki, a także zawiera pełną instrukcję w wersji cyfrowej i daje możliwość posiadania cyfrowej wersji kompletnego oficjalnego poradnika do Red Dead Redemption 2 od Piggyback. A to jeszcze nie wszystko.","rdr2_credits_additional_cast_title":"Dodatkowa obsada","rdr2_credits_main_cast_title":"Obsada","rdr2_credits_outlaws_title":"Południowe i zachodnie gangi bandytów","rdr2_credits_outsource_title":"Zewnętrzne usługi artystyczne i animacyjne","rdr2_download_android":"Pobierz oficjalną aplikację towarzyszącą Red Dead Redemption 2 z Google Play.","rdr2_download_ios":"Pobierz oficjalną aplikację towarzyszącą Red Dead Redemption 2 z App Store.","rdr2_download_label":"Pobierz obraz: {name} w rozdzielczości: {size}.","rdr2_download_pixels_label":"Pobierz obraz: {name} w rozdzielczości {size1} pikseli na {size2} pikseli.","rdr2_legacy_credits_title":"Pierwotne napisy końcowe","rdr2_pc_missions4_bonus_first_half":"Oprócz tego Red Dead Redemption 2 na PC wprowadza nowy tryb fotograficzny z mnóstwem narzędzi do upiększania pogranicza w trybie fabularnym. Róbcie zdjęcia ze swobodnego ujęcia kamery, dodawajcie filtry, naklejki lub tekst, a następnie","rdr2_pc_missions4_bonus_second_half":", aby podziwiać je mogła cała społeczność.","rdr2_pc_missions4_bonus_upload_message":"przesyłajcie","rdr2_pc_missions4_list_item1":"<span>Ozdoba ze szpona jastrzębia</span> – trwale zmniejsza tempo wyczerpywania się paska wytrzymałości podczas naciągania łuku o 30%","rdr2_pc_missions4_list_item2":"<span>Ozdoba z oka kota</span> – trwale zwiększa długość trwania efektów remediów wzmacniających o 20%","rdr2_pc_missions4_list_item3":"<span>Ozdoba z zęba rekina</span> – trwale zwiększa wzmacnianie poziomu więzi z koniem o 10%","rdr2_pc_missions4_list_item4":"<span>Ozdoba ze skorupy żółwia</span> – trwale zwiększa szybkość odnawiania się paska zdrowia o 10%","rdr2_pc_missions4_list_item5":"<span>Ozdoba z dzioba wrony</span> – trwale zwiększa ilość znajdowanej przez gracza amunicji o 10%","rdr2_pc_missions4_list_title":"5 nowych <span>ozdób</span> z nowymi efektami do zebrania:","rdr2_pc_missions4_new_mission":"<span>Nowa misja „W każdym zakątku Ziemi”</span> – zbierzcie zioła dla zielarza, aby otrzymać szereg nagród."},"pt-BR":{"rdr2_companion_app_paragraph_2":"O Aplicativo Complementar inclui o mapa completo. Você pode ver o mapa todo e aproximar o zoom, marcar destinos ou áreas de interesse com um toque na sua tela enquanto você explora e desvenda o expansivo mundo de Red Dead Redemption 2. Além disso, você pode acompanhar as informações sobre bases e estatísticas do Arthur Morgan em tempo real no seu dispositivo, possibilitando a remoção completa do HUD da tela do jogo, se desejar. O aplicativo também permite que você leia o Diário do Arthur no jogo, além de oferecer acompanhamento de estatísticas, conter o manual digital completo e uma versão digital opcional do Guia Oficial Completo de Red Dead Redemption 2 da Piggyback e mais.","rdr2_credits_additional_cast_title":"Elenco adicional","rdr2_credits_main_cast_title":"Elenco","rdr2_credits_outlaws_title":"Fora da lei do sul e oeste","rdr2_credits_outsource_title":"Serviços de arte e animação","rdr2_download_android":"Obtenha o Aplicativo Complementar Oficial de Red Dead Redemption 2 no Google Play.","rdr2_download_ios":"Baixe o Aplicativo Complementar Oficial de Red Dead Redemption 2 na App Store.","rdr2_download_label":"Baixe a imagem {name} no tamanho {size}.","rdr2_download_pixels_label":"Baixe a imagem {name} com {size1} x {size2} pixels.","rdr2_legacy_credits_title":"Créditos anteriores","rdr2_pc_missions4_bonus_first_half":"Além disso, Red Dead Redemption 2 para PC inclui o Modo Foto com diversas ferramentas para desvendar a beleza da fronteira no Modo História. Capture imagens com movimentos de câmera livre e adicione filtros, adesivos ou texto e","rdr2_pc_missions4_bonus_second_half":"para compartilhar com a comunidade.","rdr2_pc_missions4_bonus_upload_message":"carregue as fotos","rdr2_pc_missions4_list_item1":"<span>Amuleto Garra de Gavião</span> – diminui permanentemente em 30% a velocidade com que a barra de Fôlego se esgota ao usar um arco.","rdr2_pc_missions4_list_item2":"<span>Amuleto Olho de Gato</span> – aumenta permanentemente em 20% a duração dos efeitos dos tônicos fortificantes.","rdr2_pc_missions4_list_item3":"<span>Amuleto Dente de Tubarão</span> – aumenta permanentemente em 10% a experiência de vínculo com o seu cavalo.","rdr2_pc_missions4_list_item4":"<span>Amuleto Casco de Tartaruga</span> – aumenta permanentemente em 10% a velocidade com que a barra de Vida é recarregada.","rdr2_pc_missions4_list_item5":"<span>Amuleto Bico de Corvo</span> – aumenta permanentemente em 10% a quantidade de munição saqueada pelo jogador.","rdr2_pc_missions4_list_title":"5 novos <span>Amuletos</span> para coletar com novos efeitos especiais:","rdr2_pc_missions4_new_mission":"<span>Nova missão \\"Cada Palmo de Terra\\"</span> – colete as ervas solicitadas para receber recompensas."},"ru-RU":{"rdr2_companion_app_paragraph_2":"В приложении-компаньоне представлена полная карта игры. Вы можете ее просматривать и масштабировать, выставлять точки маршрута и отмечать важные объекты, что поможет вам в исследовании огромного мира Red Dead Redemption 2. В этом приложении также отображаются статусы и другие параметры Артура Моргана, поэтому вы можете отключить интерфейс в самой игре, ничего не потеряв. Кроме того, приложение содержит в себе дневник Артура, инструменты для отслеживания статистики, полную цифровую версию руководства по игре, цифровую версию официального стратегического руководства по Red Dead Redemption 2 от Piggyback и многое другое.","rdr2_credits_additional_cast_title":"Во второстепенных ролях","rdr2_credits_main_cast_title":"В главных ролях","rdr2_credits_outlaws_title":"Банды юга и запада","rdr2_credits_outsource_title":"Графика и анимация (аутсорсинг)","rdr2_download_android":"Скачать официальное приложение-компаньон Red Dead Redemption 2 из Google Play.","rdr2_download_ios":"Загрузить официальное приложение-компаньон Red Dead Redemption 2 в App Store.","rdr2_download_label":"Загрузить изображение \\"{name}\\" в размере \\"{size}\\".","rdr2_download_pixels_label":"Загрузить изображение \\"{name}\\" в размере {size1} на {size2} пикселей.","rdr2_legacy_credits_title":"Классические титры","rdr2_pc_missions4_bonus_first_half":"Также в Red Dead Redemption 2 для PC есть новый фоторежим, позволяющий запечатлеть красоты фронтира в сюжетном режиме. Фотографируйте, используя свободную камеру, добавляйте фильтры, наклейки и надписи и","rdr2_pc_missions4_bonus_second_half":", чтобы показать их другим игрокам.","rdr2_pc_missions4_bonus_upload_message":"загружайте фото","rdr2_pc_missions4_list_item1":"<span>Амулет из когтя ястреба</span> на 30% замедляет расход шкалы выносливости при натягивании тетивы.","rdr2_pc_missions4_list_item2":"<span>Амулет из глаза кошки</span> на 20% увеличивает время действия укрепляющего тоника.","rdr2_pc_missions4_list_item3":"<span>Амулет из зуба акулы</span> на 10% повышает скорость завоевания доверия лошади.","rdr2_pc_missions4_list_item4":"<span>Амулет из панциря черепахи</span> на 10% повышает скорость заполнения шкалы здоровья.","rdr2_pc_missions4_list_item5":"<span>Амулет из клюва вороны</span> на 10% увеличивает количество находимых боеприпасов.","rdr2_pc_missions4_list_title":"5 новых <span>амулетов</span>:","rdr2_pc_missions4_new_mission":"<span>Новая миссия «Дары природы»</span>: задание по сбору трав, за выполнение которого вы получите награды"},"zh-CN":{"rdr2_companion_app_paragraph_2":"配套应用包括了完整的地图。您可以通过轻触设备屏幕平移和缩放地图、设置路径点或标记区域，帮助您在广阔的 Red Dead Redemption 2 开放世界中探索、揭秘。这个应用同样会在您的设备上显示亚瑟·摩根的实时核心状态和信息，使您在电视上进行游戏时，可以选择关闭游戏内 HUD。另外，配套应用还可以让您翻看亚瑟的游戏内日记、提供数据追踪、查看数字版的完整游戏手册和 Piggyback 出品的 Red Dead Redemption 2 可选数字完整官方指南。","rdr2_credits_additional_cast_title":"额外演职员表","rdr2_credits_main_cast_title":"演职员表","rdr2_credits_outlaws_title":"南部和西部的亡命之徒","rdr2_credits_outsource_title":"外包美术及动画服务","rdr2_download_android":"在 Google Play 上获取 Red Dead Redemption 2 官方配套应用。","rdr2_download_ios":"在 App Store 中下载 Red Dead Redemption 2 官方配套应用。","rdr2_download_label":"下载图片 {name}，大小 {size}。","rdr2_download_pixels_label":"下载图片 {name}，大小为 {size1} 个像素点 x {size2} 个像素点。","rdr2_legacy_credits_title":"往期致谢","rdr2_pc_missions4_bonus_first_half":"另外，Red Dead Redemption 2 PC 版包括了全新照片模式，带有各种各样的工具，供您在故事模式中解锁边疆美景。使用自由视角来捕捉图像，添加滤镜、贴纸或文字后","rdr2_pc_missions4_bonus_second_half":"即可与社区分享。","rdr2_pc_missions4_bonus_upload_message":"上传这些图像","rdr2_pc_missions4_list_item1":"<span>鹰爪</span>：使拉弓时的体力值条消耗速度永久性减慢 30%","rdr2_pc_missions4_list_item2":"<span>猫眼</span>：使强化补剂效果的持续时间永久性增加 20%","rdr2_pc_missions4_list_item3":"<span>鲨鱼牙</span>：使马匹默契经验值永久性增加 10%","rdr2_pc_missions4_list_item4":"<span>龟壳</span>：使生命值条恢复速度永久性加快 10%","rdr2_pc_missions4_list_item5":"<span>乌鸦喙</span>：使搜刮的弹药数量永久性增加 10%","rdr2_pc_missions4_list_title":"5 个全新<span>小饰物</span>，具备新的效果：","rdr2_pc_missions4_new_mission":"<span>全新任务“找遍天涯海角”</span>：收集所需的草药以获得各种奖励"},"zh-TW":{"rdr2_companion_app_paragraph_2":"同伴應用程式包含完整地圖。您可以平移及縮放地圖，只需輕輕點按螢幕，就能設置導航點或標記特殊地點，協助您一路探索和發掘 Red Dead Redemption 2 的廣闊世界。此外，您可以在您的智慧型裝置上，即時追蹤亞瑟．摩根的核心資訊和數據。讓您甚至可以在遊玩過程中，隨心所欲關閉電視螢幕上所有的遊戲抬頭顯示（HUD）。不只如此，您還可以使用此應用程式，查看亞瑟遊戲內的日誌、進行數據追蹤；且附有完整的數位遊戲手冊，還有由 Piggyback 製作，可以隨需要選購的數位版《Red Dead Redemption 2 官方完全攻略》，以及更多。","rdr2_credits_additional_cast_title":"額外演出名單","rdr2_credits_main_cast_title":"演出名單","rdr2_credits_outlaws_title":"南方與西方的黑幫","rdr2_credits_outsource_title":"發包美術與動畫服務","rdr2_download_android":"在 Google Play 取得 Red Dead Redemption 2 官方同伴應用程式。","rdr2_download_ios":"在 App Store 下載 Red Dead Redemption 2 官方同伴應用程式。","rdr2_download_label":"下載 {size} 大小的「{name}」圖片。","rdr2_download_pixels_label":"下載 {size1}x{size2} 像素的「{name}」圖片。","rdr2_legacy_credits_title":"經典片尾名單","rdr2_pc_missions4_bonus_first_half":"此外，Red Dead Redemption 2 PC 版還有全新拍照模式，可讓您在故事模式中利用各種工具解開邊境之美。自由移動相機來拍照，然後套上濾鏡、加上貼圖或文字，再","rdr2_pc_missions4_bonus_second_half":"與社群分享。","rdr2_pc_missions4_bonus_upload_message":"上傳","rdr2_pc_missions4_list_item1":"<span>隼鷹爪</span>：永久降低拉弓時體力值條的消耗速度 30%","rdr2_pc_missions4_list_item2":"<span>貓眼</span>：永久提升增強補藥的效果長度 20%","rdr2_pc_missions4_list_item3":"<span>鯊魚牙齒</span>：永久提升玩家的馬匹親密度經驗值 10%","rdr2_pc_missions4_list_item4":"<span>龜殼</span>：永久提升生命值條的恢復速度 10%","rdr2_pc_missions4_list_item5":"<span>鴉喙</span>：永久提升玩家搜刮的彈藥量 10%","rdr2_pc_missions4_list_title":"五款具有新效果的全新<span>飾品</span>：","rdr2_pc_missions4_new_mission":"<span>「直到大地的盡頭」</span>全新任務：採集所需的藥草以獲得各種獎勵"}}');
